                <div className='sign-left'>
                    <ul className='user-pages'>
                        <li><Link className='custom-btn' to='/updateprofile'>Update Your Profile</Link> </li>
                        <li><Link className='custom-btn' to='/uplaodDocument'>Upload Your Documents</Link> </li>
                        <li><Link className='custom-btn' to='/inquery'>Inquery</Link> </li>
                        <li><Link className='custom-btn' to='/pricing'>Pricing</Link> </li>
                        
                        <li><button className="custom-btn" onClick={removeToken}>Log Out</button></li>
                    </ul>
                </div>
                <div className='sign-right profile-details'>
                    <div className='main-form'>
                        <h1>Welcome to <span className='white-color'>{username}</span>,</h1>
                        <h3>First Name is : <span className='white-color'>{username}</span></h3>
                        <h3>Last Name is : <span className='white-color'>{lastname}</span></h3>
                        <h3>Contact Number is : <span className='white-color'>{contactnumber}</span></h3>
                        <h3>City Id is : <span className='white-color'>{cityid}</span></h3>
                        <h3>Business Name is : <span className='white-color'>{bname}</span></h3>
